  `orderDate` date NULL DEFAULT NULL COMMENT '下单日期',
  `number` int(11) NOT NULL COMMENT '需求数量#要求大于0#',
  `requiredDeliveryTime` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '要求交期#时间要晚于当前日期#',
  `customerID` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '客户信息',
  `productID` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '产品信息',
