  `state` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '当前订单状态#0为未发布 1为发布 2为暂停 3为完成 4为取消#',
  `note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `isDel` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '删除否#0为存在 1为删除#',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `fk_订单表_实体信息表_1`(`customerID`) USING BTREE,
  INDEX `fk_订单表_产品表_1`(`productID`) USING BTREE,
  INDEX `fk_订单表_发票信息表_1`(`invoiceID`) USING BTREE,
  INDEX `fk_订单表_合同表_1`(`contractID`) USING BTREE,
  CONSTRAINT `fk_订单表_产品表_1` FOREIGN KEY (`productID`) REFERENCES `aw_product` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `fk_订单表_发票信息表_1` FOREIGN KEY (`invoiceID`) REFERENCES `aw_invoice` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `fk_订单表_合同表_1` FOREIGN KEY (`contractID`) REFERENCES `aw_contract` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `fk_订单表_实体信息表_1` FOREIGN KEY (`customerID`) REFERENCES `aw_partner` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表\r\n由客户，订单，材料等构成的订单实体\r\n存储   订单信息，合同信息，可客户信息，材料信息等' ROW_FORMAT = Dynamic;

